import React from 'react';
import {
    Text,
    View,
    StyleSheet,
    TextInput,
    Image,
  } from "react-native";
  import { styles } from "../../Styles";

const Post = ({post}) => {
    return (
        <View style={styles.container}>
            <Text>{post.description}</Text>
            <Image style={{width: 340, height: 200}} source={{uri: post.image}} />
        </View>
    )
}

export default Post;
